import React, { useState } from "react";
import "./App.css";

// Set this to your local or deployed backend URL
//const BASE_URL = "http://localhost:8080"; // ✅ IBM Code Engine URL will replace this later

function App() {
  const [step, setStep] = useState(1);
  const [inputText, setInputText] = useState("");
  const [questions, setQuestions] = useState([]);
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [answer, setAnswer] = useState("");
  const [feedback, setFeedback] = useState("");
  const [results, setResults] = useState([]);

  const handleStart = async () => {
    try {
      const response = await fetch(`${BASE_URL}/api/generate`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ input: inputText }),
      });

      if (!response.ok) throw new Error(`Server error: ${response.status}`);

      const data = await response.json();
      if (data.questions && Array.isArray(data.questions)) {
        setQuestions(data.questions);
        setStep(2);
      } else {
        alert("⚠️ Backend returned no questions.");
      }
    } catch (err) {
      console.error("❌ Error generating questions:", err);
      alert("Failed to connect to backend. Is Flask running on port 8080?");
    }
  };

  const handleSubmitAnswer = async () => {
    const question = questions[currentQuestionIndex];

    try {
      const response = await fetch(`${BASE_URL}/api/evaluate`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ question, answer }),
      });

      if (!response.ok) throw new Error(`Server error: ${response.status}`);

      const data = await response.json();
      const newResults = [
        ...results,
        { question, answer, feedback: data.feedback || "No feedback provided" },
      ];

      setResults(newResults);
      setAnswer("");
      setFeedback("");

      if (currentQuestionIndex + 1 < questions.length) {
        setCurrentQuestionIndex(currentQuestionIndex + 1);
      } else {
        setStep(3);
      }
    } catch (err) {
      console.error("❌ Error evaluating answer:", err);
      alert("Evaluation failed. Try again later.");
    }
  };

  if (step === 1) {
    return (
      <div className="App">
        <h1>Interview Trainer</h1>
        <textarea
          rows="6"
          value={inputText}
          onChange={(e) => setInputText(e.target.value)}
          placeholder="Paste your resume or enter job role..."
        />
        <button onClick={handleStart}>Start Practice</button>
      </div>
    );
  }

  if (step === 2) {
    const q = questions[currentQuestionIndex];
    return (
      <div className="App">
        <h2>Question {currentQuestionIndex + 1}</h2>
        <p>{q}</p>
        <textarea
          rows="4"
          value={answer}
          onChange={(e) => setAnswer(e.target.value)}
          placeholder="Type your answer..."
        />
        <button onClick={handleSubmitAnswer}>Submit Answer</button>
        {feedback && <p><strong>Feedback:</strong> {feedback}</p>}
      </div>
    );
  }

  if (step === 3) {
    return (
      <div className="App">
        <h1>Session Complete</h1>
        {results.map((r, i) => (
          <div key={i}>
            <p><strong>Q{i + 1}:</strong> {r.question}</p>
            <p><strong>Your Answer:</strong> {r.answer}</p>
            <p><strong>Feedback:</strong> {r.feedback}</p>
            <hr />
          </div>
        ))}
      </div>
    );
  }

  return null;
}

export default App;
